    function trim(string) { return (string || "").replace(/^\s+/, '').replace(/\s+$/g, ''); }

    function validate(id) {

        var u = $.byId(id),
            newValue = u.value.replace(/[^A-Za-z0-9_\^ !#$\(\)+\-\.\/;<=>?@\[\]{|}~\\]/g, "");
        if (u.value !== newValue) u.value = newValue;
    }

