        var key = 'cookieTest';
        document.cookie = key + '=1';
        if (document.cookie.indexOf(key + "=") != -1) {
            document.cookie = key + '=1; expires=Thu, 01 Jan 1970 00:00:00 GMT';
            return false; 
        }
        return true;
    }
    function showPwRules(isError) {
        var newPw = $.byId('newPassword').value,
            confirmPw = $.byId('confirmPassword').value,
            type = isError ? " error" : " info";
        if (newPw.length == 0) {
            $.byId('newPassword').className = isError ? "error" : "";
            $.byId('confirmPassword').className = "";
            $.byId('changePW').className = 'message visible' + type;
            $.byId('pwRules').className = 'message' + type;
            $.byId('pwMismatch').className = 'message' + type;
            $.byId('loginMsg').className = 'message info';
        } else if (newPw.length < 6 || newPw.length > 64 || trim(newPw) != newPw) {
            $.byId('newPassword').className = isError ? "error" : "";
            $.byId('confirmPassword').className = "";
            $.byId('changePW').className = 'message';
            $.byId('pwRules').className = 'message visible' + type;
            $.byId('pwMismatch').className = 'message';
            $.byId('loginMsg').className = 'message info';
        } else if (newPw != confirmPw) {
            $.byId('newPassword').className = "";
            $.byId('confirmPassword').className = isError ? "error" : "";
            $.byId('changePW').className = 'message';
            $.byId('pwRules').className = 'message';
            $.byId('pwMismatch').className = 'message visible' + type;
            $.byId('loginMsg').className = 'message info';
        } else {
            $.byId('newPassword').className = "";
            $.byId('confirmPassword').className = "";
            $.byId('changePW').className = 'message';
            $.byId('pwRules').className = 'message';
            $.byId('pwMismatch').className = 'message';
            $.byId('loginMsg').className = 'message info';
        }
