        $.byId('licAccept').value = null;
        $.byId('submit').focus();
        if (changePW) {

            var newPw = trim($.byId('newPassword').value),
                confirmPw = trim($.byId('confirmPassword').value);
            if (newPw.length < 6 || newPw.length > 64) {
                $.byId('newPassword').focus();
                pauseAndShowPwError();
                return false;
            }
            if (newPw != confirmPw) {
                $.byId('confirmPassword').focus();
                pauseAndShowPwError();
                return false;
            }
            $.byId('newPassword').value = newPw;
            $.byId('confirmPassword').value = confirmPw;
        } else {

            var v;
            if (superuser.length) {
                $.byId('user').value = superuser;
            } else {
                if (!(v = trim($.byId('user').value))) {
                    $.byId('user').focus();
                    return false;
                }
                $.byId('user').value = v;
            }

            if (!(v = trim($.byId('password').value))) {
                $.byId('password').focus();
                return false;
            }
            $.byId('password').value = v;
        }

        $.byId('tz').value = (new Date()).getTimezoneOffset();
        $.byId('submit').disabled = true;
        document.body.className += ' wait';
        return true;
    }

