                'Firefox\/': 38,    
                'Chrome\/': 42,     
                'Edge\/': 12,       
                'Trident\/': 7      
            };
        for (var browser in supportedAgents) {
            var minVer = supportedAgents[browser];
            var re = new RegExp(browser + '(' + digits + decimal + digits + ')');
            var results = re.exec(navigator.userAgent);
            if (!results) continue;
            var ver = parseFloat(results[1]); // 1st parenthesized match
            if (ver < minVer) {
                $.byId('unsupportedMsg').className += ' visible';
                break;
            }
        }

        if (changePW) {
